const e=JSON.parse('{"key":"v-6cb83f54","path":"/basic-skill/algorithms/sort/bubble-sort.html","title":"冒泡排序","lang":"zh-CN","frontmatter":{"description":"冒泡排序 概念 ”冒泡排序“（Bubble Sort）是一种最简单的交换排序方法，它通过两两比较相邻记录的关键字，如果发生逆序，则进行交换，从而使关键字小的记录如气泡一般逐渐往上“漂浮”（左移），或者使关键字大的记录如石块一样逐渐向下“坠落”（右移）。 代码 func bubbleSort(num []int) []int { length := len(num) for i := 0; i &lt; length; i++ { for j := 0; j &lt; length-i-1; j++ { if num[j] &gt; num[j+1] { num[j], num[j+1] = num[j+1], num[j] } } } return num }","head":[["meta",{"property":"og:url","content":"https://renfakai.com/basic-skill/algorithms/sort/bubble-sort.html"}],["meta",{"property":"og:site_name","content":"天道酬勤"}],["meta",{"property":"og:title","content":"冒泡排序"}],["meta",{"property":"og:description","content":"冒泡排序 概念 ”冒泡排序“（Bubble Sort）是一种最简单的交换排序方法，它通过两两比较相邻记录的关键字，如果发生逆序，则进行交换，从而使关键字小的记录如气泡一般逐渐往上“漂浮”（左移），或者使关键字大的记录如石块一样逐渐向下“坠落”（右移）。 代码 func bubbleSort(num []int) []int { length := len(num) for i := 0; i &lt; length; i++ { for j := 0; j &lt; length-i-1; j++ { if num[j] &gt; num[j+1] { num[j], num[j+1] = num[j+1], num[j] } } } return num }"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-06-20T15:03:08.000Z"}],["meta",{"property":"article:modified_time","content":"2023-06-20T15:03:08.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"冒泡排序\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-06-20T15:03:08.000Z\\",\\"author\\":[]}"]]},"headers":[{"level":2,"title":"概念","slug":"概念","link":"#概念","children":[]},{"level":2,"title":"代码","slug":"代码","link":"#代码","children":[]},{"level":2,"title":"总结","slug":"总结","link":"#总结","children":[]}],"git":{"createdTime":1687273388000,"updatedTime":1687273388000,"contributors":[{"name":"renfakai","email":"rfk1118@gmail.com","commits":1}]},"readingTime":{"minutes":0.61,"words":183},"filePathRelative":"basic-skill/algorithms/sort/bubble-sort.md","localizedDate":"2023年6月20日","excerpt":"<h1> 冒泡排序</h1>\\n<h2> 概念</h2>\\n<p>”冒泡排序“（Bubble Sort）是一种最简单的交换排序方法，它通过两两比较相邻记录的关键字，如果发生逆序，则进行交换，从而使关键字小的记录如气泡一般逐渐往上“漂浮”（左移），或者使关键字大的记录如石块一样逐渐向下“坠落”（右移）。</p>\\n<h2> 代码</h2>\\n<div class=\\"language-Go line-numbers-mode\\" data-ext=\\"Go\\"><pre class=\\"language-Go\\"><code>func bubbleSort(num []int) []int {\\n  length := len(num)\\n  for i := 0; i &lt; length; i++ {\\n    for j := 0; j &lt; length-i-1; j++ {\\n      if num[j] &gt; num[j+1] {\\n        num[j], num[j+1] = num[j+1], num[j]\\n      }\\n    }\\n  }\\n  return num\\n}\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div>","copyright":{},"autoDesc":true}');export{e as data};
